  false,\n\t\"url\": null,\n\t\"notes\": \"This database is an Arc/Info implementation
  of the 1:500,000 scale Geology Map of Kansas, Mu00ad23, 1991. This work wasperformed
  by the Automated Cartography section of the Kansas Geological Survey, under contract
  to the Kansas Water Office. The goal of this project was to capture, in Arc/Info
  structures, the spatial and attribute information portrayed on this map. The data
  for Map Mu00ad23 was digitized from an original paper copy publication of the Geologic
  Map of Kansas, Map Mu00ad1, 1964. That map incorporated a 1:500,000 scale, USGS
  base map. Because of this source and scale, there are some edge matching problems
  with the state boundary as maintained by the Kansas Cartographic Database (KCD).
  Two classes of spatial feature are represented in the Arc/Info version of the geology
  map: polygons depicting major geologic units, and lines demarking the bases of key
  geologic formations within the units.\",\n\t\"license_title\": null,\n\t\"extras\":
